class AnswerList {
  AnswerList({
    String? id,
    String? answer,
    String? correctAnswer,
    num? isRight,
    num? sort,}){
    _id = id;
    _answer = answer;
    _correctAnswer = correctAnswer;
    _isRight = isRight;
    _sort = sort;
  }

  AnswerList.fromJson(dynamic json) {
    _id = json['id'];
    _answer = json['answer'];
    _correctAnswer = json['correctAnswer'];
    _isRight = json['isRight'];
    _sort = json['sort'];
  }
  String? _id;
  String? _answer;
  String? _correctAnswer;
  num? _isRight;
  num? _sort;
  AnswerList copyWith({  String? id,
    String? answer,
    String? correctAnswer,
    num? isRight,
    num? sort,
  }) => AnswerList(  id: id ?? _id,
    answer: answer ?? _answer,
    correctAnswer: correctAnswer ?? _correctAnswer,
    isRight: isRight ?? _isRight,
    sort: sort ?? _sort,
  );
  String? get id => _id;
  String? get answer => _answer;
  String? get correctAnswer => _correctAnswer;
  num? get isRight => _isRight;
  num? get sort => _sort;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['answer'] = _answer;
    map['correctAnswer'] = _correctAnswer;
    map['isRight'] = _isRight;
    map['sort'] = _sort;
    return map;
  }

}